// src/components/NavBar.js
import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';

const NavBar = () => {
  const [isOpen, setIsOpen] = useState(false); // For mobile menu toggle
  const activeClassName = 'text-gray-800 font-bold';

  return (
    <nav className="bg-gray-500 bg-opacity-50 p-4">
      <div className="container mx-auto flex justify-between items-center">
        {/* Logo or Brand Name */}
        <div className="text-white font-bold text-xl">
          <NavLink to="/">MyApp</NavLink>
        </div>

        {/* Hamburger Menu for Mobile */}
        <div className="md:hidden">
          <button
            onClick={() => setIsOpen(!isOpen)}
            className="text-white focus:outline-none"
          >
            <svg
              className="w-6 h-6"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
              xmlns="http://www.w3.org/2000/svg"
            >
              {isOpen ? (
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  strokeWidth="2"
                  d="M6 18L18 6M6 6l12 12"
                ></path>
              ) : (
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  strokeWidth="2"
                  d="M4 6h16M4 12h16M4 18h16"
                ></path>
              )}
            </svg>
          </button>
        </div>

        {/* Navigation Links */}
        <div className={`md:flex space-x-4 ${isOpen ? 'block' : 'hidden'}`}>
          <NavLink
            to="/"
            end
            className={({ isActive }) =>
              `text-white px-3 py-2 rounded-md transition duration-300 ${
                isActive ? activeClassName : ''
              } hover:font-bold block md:inline-block`
            }
            onClick={() => setIsOpen(false)} // Close menu on link click
          >
            Home
          </NavLink>
          <NavLink
            to="/profile"
            className={({ isActive }) =>
              `text-white px-3 py-2 rounded-md transition duration-300 ${
                isActive ? activeClassName : ''
              } hover:bg-red-700 block md:inline-block`
            }
            onClick={() => setIsOpen(false)}
          >
            Profile
          </NavLink>
          <NavLink
            to="/search"
            className={({ isActive }) =>
              `text-white px-3 py-2 rounded-md transition duration-300 ${
                isActive ? activeClassName : ''
              } hover:bg-red-700 block md:inline-block`
            }
            onClick={() => setIsOpen(false)}
          >
            Search
          </NavLink>
        </div>
      </div>
    </nav>
  );
};

export default NavBar;
